description:
A fast HL7 to XDocument parser.

Example usage:
var parser = new HL7toXDocumentParser.Parser();
var xDoc = parser.Parse(hl7);
var messageType = (from elem in xDoc.Descendants("MSH.9.1") select elem.Value).FirstOrDefault();

summary:
Gladdress.com API Client Library

Usage:

GladdressProfile gladdressProfile = new GladdressProfile("046632BC-8B3A-485D-8213-9527132C97C9");
List<string> fields = gladdressProfile->GetFields();
var firstName = gladdressProfile.Get("FirstName");
